    }
    
    render() {
        // HTML
        return (
            <div>
                <div>
                    <h4 style={{color:'#FFF'}}>Welcome, Here are questions</h4>
                </div>
                <div className="add_question">Create new Question</div>
                <div className="question_list">
                    {
                        this.state.questions.map((question, index)=>{
                            return <div key={index}><h4>{ question.title } <button onClick={this.openQuestion}>Open</button></h4></div>
                        })
                    }
                    <div key={1}><h4>TITLE HERE</h4><button onClick={this.openQuestion}>Open</button></div>
                </div>
            </div>
        );
      }
}
